                    );
            } else {
                parts.push("Partial coverage after refactor".to_string());
            }
        }
        if impact.complexity_reduction > 0.0 {
            parts
                .push(
                    ::alloc::__export::must_use({
                        ::alloc::fmt::format(
                            format_args!(
                                "-{0} complexity",
                                impact.complexity_reduction as i32,
                            ),
