        }
        if impact.risk_reduction > 0.0 {
            parts
                .push(
                    ::alloc::__export::must_use({
                        ::alloc::fmt::format(
                            format_args!("-{0:.1} risk", impact.risk_reduction),
                        )
                    }),
                );
        }
        if impact.lines_reduction > 0 {
            parts
                .push(
                    ::alloc::__export::must_use({
                        ::alloc::fmt::format(
                            format_args!("-{0} LOC", impact.lines_reduction),
                        )
                    }),
                );
        }
