mod dependencies {
    use crate::core::{Dependency, DependencyKind};
    use tree_sitter::Node;
    pub fn extract_dependencies(node: Node, source: &str) -> Vec<Dependency> {
        let mut dependencies = Vec::new();
        visit_node_for_dependencies(node, source, &mut dependencies);
        dependencies
    }
    fn visit_node_for_dependencies(
        node: Node,
        source: &str,
        dependencies: &mut Vec<Dependency>,
    ) {
        type ExtractorFn = fn(&Node, &str, &mut Vec<Dependency>);
        static NODE_EXTRACTORS: &[(&str, ExtractorFn)] = &[
            ("import_statement", extract_import_statement),
            ("call_expression", extract_call_expression),
            ("import", extract_dynamic_import),
        ];
        if let Some((_, extractor)) = NODE_EXTRACTORS
            .iter()
            .find(|(kind, _)| *kind == node.kind())
        {
            extractor(&node, source, dependencies);
        }
        node.children(&mut node.walk())
            .for_each(|child| visit_node_for_dependencies(child, source, dependencies));
    }
    fn extract_import_statement(
        node: &Node,
        source: &str,
        dependencies: &mut Vec<Dependency>,
    ) {
        if let Some(module_name) = node
            .child_by_field_name("source")
            .and_then(|source_node| source_node.utf8_text(source.as_bytes()).ok())
        {
            dependencies
                .push(Dependency {
                    name: clean_module_name(module_name),
                    kind: DependencyKind::Import,
                });
        }
    }
    fn extract_call_expression(
        node: &Node,
        source: &str,
        dependencies: &mut Vec<Dependency>,
    ) {
        let is_require = node
            .child_by_field_name("function")
            .and_then(|func| func.utf8_text(source.as_bytes()).ok())
            .map(|name| name == "require")
            .unwrap_or(false);
        if !is_require {
            return;
        }
        if let Some(args) = node.child_by_field_name("arguments") {
            extract_string_arguments(&args, source, dependencies);
        }
    }
    fn extract_dynamic_import(
        node: &Node,
        source: &str,
        dependencies: &mut Vec<Dependency>,
    ) {
        if let Some(args) = node
            .parent()
            .filter(|parent| parent.kind() == "call_expression")
            .and_then(|parent| parent.child_by_field_name("arguments"))
        {
            extract_string_arguments(&args, source, dependencies);
        }
    }
    fn extract_string_arguments(
        args_node: &Node,
        source: &str,
        dependencies: &mut Vec<Dependency>,
    ) {
        args_node
            .children(&mut args_node.walk())
            .filter(|child| child.kind() == "string")
            .filter_map(|child| child.utf8_text(source.as_bytes()).ok())
            .for_each(|module_name| {
                dependencies
                    .push(Dependency {
                        name: clean_module_name(module_name),
                        kind: DependencyKind::Import,
                    })
            });
    }
    fn clean_module_name(module_name: &str) -> String {
        module_name.trim_matches(|c| c == '"' || c == '\'' || c == '`').to_string()
    }
}

pub mod cyclomatic {
    use syn::{visit::Visit, Block, Expr, Stmt};
    pub fn calculate_cyclomatic(block: &Block) -> u32 {
        let mut visitor = CyclomaticVisitor {
            complexity: 1,
            in_condition: false,
        };
        visitor.visit_block(block);
        visitor.complexity
    }
    struct CyclomaticVisitor {
        complexity: u32,
        in_condition: bool,
    }
    fn calculate_expr_complexity(expr: &Expr, in_condition: bool) -> u32 {
        match expr {
            Expr::If(expr_if) => {
                let mut count = 1;
                if expr_if.else_branch.is_some() {
                    count += 1;
                }
                count
            }
            Expr::While(_) | Expr::ForLoop(_) | Expr::Loop(_) => 1,
            Expr::Try(_) => 1,
            Expr::Match(expr_match) => expr_match.arms.len().saturating_sub(1) as u32,
            Expr::Binary(binary) if is_logical_operator(&binary.op) && !in_condition => 1,
            _ => 0,
        }
    }
    impl<'ast> Visit<'ast> for CyclomaticVisitor {
        fn visit_expr(&mut self, expr: &'ast Expr) {
            let complexity_delta = calculate_expr_complexity(expr, self.in_condition);
            self.complexity += complexity_delta;
            let was_in_condition = self.in_condition;
            if match expr {
                Expr::If(_) | Expr::While(_) => true,
                _ => false,
            } {
                self.in_condition = true;
            }
            syn::visit::visit_expr(self, expr);
            self.in_condition = was_in_condition;
        }
        fn visit_stmt(&mut self, stmt: &'ast Stmt) {
            syn::visit::visit_stmt(self, stmt);
        }
    }
    fn is_logical_operator(op: &syn::BinOp) -> bool {
        match op {
            syn::BinOp::And(_) | syn::BinOp::Or(_) => true,
            _ => false,
        }
    }
    pub fn calculate_cyclomatic_for_function(complexity: u32, params: usize) -> u32 {
        complexity + params.saturating_sub(1) as u32
    }
    pub fn combine_cyclomatic(branches: Vec<u32>) -> u32 {
        branches.iter().sum::<u32>() + 1
    }
}

pub mod markdown {
    use crate::core::{AnalysisResults, DebtItem, FunctionMetrics, Priority};
    use crate::debt::total_debt_score;
    use crate::io::output::{
        build_summary_rows, complexity_header_lines, get_recommendation,
        get_top_complex_functions, OutputWriter,
    };
    use crate::risk::{RiskDistribution, RiskInsight};
    use std::io::Write;
    pub struct MarkdownWriter<W: Write> {
        writer: W,
    }
    impl<W: Write> MarkdownWriter<W> {
        pub fn new(writer: W) -> Self {
            Self { writer }
        }
    }
    impl<W: Write> OutputWriter for MarkdownWriter<W> {
        fn write_results(&mut self, results: &AnalysisResults) -> anyhow::Result<()> {
            let writers: Vec<fn(&mut Self, &AnalysisResults) -> anyhow::Result<()>> = <[_]>::into_vec(
                ::alloc::boxed::box_new([
                    |w, r| w.write_header(r),
                    |w, r| w.write_summary(r),
                    |w, r| w.write_complexity_analysis(r),
                    |w, r| w.write_technical_debt(r),
                    |w, _| w.write_recommendations(),
                ]),
            );
            writers.iter().try_for_each(|writer| writer(self, results))
        }
        fn write_risk_insights(&mut self, insights: &RiskInsight) -> anyhow::Result<()> {
            self.write_risk_header()?;
            self.write_risk_summary(insights)?;
            self.write_risk_distribution(&insights.risk_distribution)?;
            Ok(())
        }
    }
    impl<W: Write> MarkdownWriter<W> {
        fn write_header(&mut self, results: &AnalysisResults) -> anyhow::Result<()> {
            let header_lines = [
                "# Debtmap Analysis Report".to_string(),
                String::new(),
                ::alloc::__export::must_use({
                    ::alloc::fmt::format(
                        format_args!(
                            "Generated: {0}",
                            results.timestamp.format("%Y-%m-%d %H:%M:%S UTC"),
                        ),
                    )
                }),
                "Version: 0.1.0".to_string(),
                String::new(),
            ];
            header_lines
                .iter()
                .try_for_each(|line| {
                    self.writer.write_fmt(format_args!("{0}\n", line))
                })?;
            Ok(())
        }
        fn write_summary(&mut self, results: &AnalysisResults) -> anyhow::Result<()> {
            self.write_summary_header()?;
            self.write_summary_metrics(results)?;
            self.writer.write_fmt(format_args!("\n"))?;
            Ok(())
        }
        fn write_summary_header(&mut self) -> anyhow::Result<()> {
            self.writer.write_fmt(format_args!("## Executive Summary\n"))?;
            self.writer.write_fmt(format_args!("\n"))?;
            self.writer.write_fmt(format_args!("| Metric | Value | Status |\n"))?;
            self.writer.write_fmt(format_args!("|--------|-------|--------|\n"))?;
            Ok(())
        }
        fn write_summary_metrics(
            &mut self,
            results: &AnalysisResults,
        ) -> anyhow::Result<()> {
            let debt_score = total_debt_score(&results.technical_debt.items);
            let debt_threshold = 100;
            build_summary_rows(results, debt_score, debt_threshold)
                .into_iter()
                .try_for_each(|(metric, value, status)| {
                    self.write_summary_row(metric, &value, &status)
                })
        }
        fn write_summary_row(
            &mut self,
            metric: &str,
            value: &str,
            status: &str,
        ) -> anyhow::Result<()> {
            self.writer
                .write_fmt(
                    format_args!("| {0} | {1} | {2} |\n", metric, value, status),
                )?;
            Ok(())
        }
        fn write_complexity_analysis(
            &mut self,
            results: &AnalysisResults,
        ) -> anyhow::Result<()> {
            if results.complexity.metrics.is_empty() {
                return Ok(());
            }
            self.write_complexity_header()?;
            self.write_complexity_table(results)?;
            Ok(())
        }
        fn write_complexity_header(&mut self) -> anyhow::Result<()> {
            complexity_header_lines()
                .iter()
                .try_for_each(|line| {
                    self.writer.write_fmt(format_args!("{0}\n", line))
                })?;
            Ok(())
        }
        fn write_complexity_table(
            &mut self,
            results: &AnalysisResults,
        ) -> anyhow::Result<()> {
            let top_complex = get_top_complex_functions(&results.complexity.metrics, 5);
            for func in top_complex {
                self.write_complexity_row(func)?;
            }
            self.writer.write_fmt(format_args!("\n"))?;
            Ok(())
        }
        fn write_complexity_row(
            &mut self,
            func: &FunctionMetrics,
        ) -> anyhow::Result<()> {
            self.writer
                .write_fmt(
                    format_args!(
                        "| {0}:{1} | {2} | {3} | {4} | {5} |\n",
                        func.file.display(),
                        func.line,
                        func.name,
                        func.cyclomatic,
                        func.cognitive,
                        get_recommendation(func),
                    ),
                )?;
            Ok(())
        }
        fn write_technical_debt(
            &mut self,
            results: &AnalysisResults,
        ) -> anyhow::Result<()> {
            if results.technical_debt.items.is_empty() {
                return Ok(());
            }
            self.write_technical_debt_header()?;
            self.write_high_priority_items(&results.technical_debt.items)?;
            Ok(())
        }
        fn write_technical_debt_header(&mut self) -> anyhow::Result<()> {
            self.writer.write_fmt(format_args!("## Technical Debt\n"))?;
            self.writer.write_fmt(format_args!("\n"))?;
            Ok(())
        }
        fn write_risk_header(&mut self) -> anyhow::Result<()> {
            self.writer.write_fmt(format_args!("## Risk Analysis\n"))?;
            self.writer.write_fmt(format_args!("\n"))?;
            Ok(())
        }
        fn write_risk_summary(&mut self, insights: &RiskInsight) -> anyhow::Result<()> {
            self.writer.write_fmt(format_args!("### Risk Summary\n"))?;
            self.writer
                .write_fmt(
                    format_args!(
                        "- Codebase Risk Score: {0:.1}\n",
                        insights.codebase_risk_score,
                    ),
                )?;
            if let Some(correlation) = insights.complexity_coverage_correlation {
                self.writer
                    .write_fmt(
                        format_args!(
                            "- Complexity-Coverage Correlation: {0:.2}\n",
                            correlation,
                        ),
                    )?;
            }
            self.writer.write_fmt(format_args!("\n"))?;
            Ok(())
        }
        fn write_risk_distribution(
            &mut self,
            distribution: &RiskDistribution,
        ) -> anyhow::Result<()> {
            self.writer.write_fmt(format_args!("### Risk Distribution\n"))?;
            let distribution_items = [
                ("Critical", distribution.critical_count),
                ("High", distribution.high_count),
                ("Medium", distribution.medium_count),
                ("Low", distribution.low_count),
                ("Well Tested", distribution.well_tested_count),
            ];
            distribution_items
                .iter()
                .try_for_each(|(label, count)| {
                    self.writer.write_fmt(format_args!("- {0}: {1}\n", label, count))
                })?;
            self.writer.write_fmt(format_args!("\n"))?;
            Ok(())
        }
        fn write_high_priority_items(
            &mut self,
            items: &[DebtItem],
        ) -> anyhow::Result<()> {
            let high_priority: Vec<_> = items
                .iter()
                .filter(|item| self.is_high_priority(item))
                .collect();
            if high_priority.is_empty() {
                return Ok(());
            }
            self.writer
                .write_fmt(
                    format_args!("### High Priority ({0} items)\n", high_priority.len()),
                )?;
            high_priority
                .iter()
                .take(10)
                .try_for_each(|item| self.write_debt_item(item))?;
            self.writer.write_fmt(format_args!("\n"))?;
            Ok(())
        }
        fn is_high_priority(&self, item: &DebtItem) -> bool {
            match item.priority {
                Priority::High | Priority::Critical => true,
                _ => false,
            }
        }
        fn write_debt_item(&mut self, item: &DebtItem) -> anyhow::Result<()> {
            self.writer
                .write_fmt(
                    format_args!(
                        "- [ ] `{0}:{1}` - {2}\n",
                        item.file.display(),
                        item.line,
                        item.message,
                    ),
                )?;
            Ok(())
        }
        fn write_recommendations(&mut self) -> anyhow::Result<()> {
            self.writer.write_fmt(format_args!("## Recommendations\n"))?;
            self.writer.write_fmt(format_args!("\n"))?;
            let recommendations = [
                "1. **Immediate Action**: Address high-priority debt items and refactor top complexity hotspots",
                "2. **Short Term**: Reduce code duplication by extracting common functionality",
                "3. **Long Term**: Establish complexity budget and monitor trends over time",
            ];
            recommendations
                .iter()
                .try_for_each(|rec| self.writer.write_fmt(format_args!("{0}\n", rec)))?;
            Ok(())
        }
    }
}

pub mod walker {
    use crate::core::Language;
    use anyhow::Result;
    use ignore::WalkBuilder;
    use std::path::{Path, PathBuf};
    pub struct FileWalker {
        root: PathBuf,
        languages: Vec<Language>,
        ignore_patterns: Vec<String>,
    }
    impl FileWalker {
        pub fn new(root: PathBuf) -> Self {
            Self {
                root,
                languages: <[_]>::into_vec(
                    ::alloc::boxed::box_new([
                        Language::Rust,
                        Language::Python,
                        Language::JavaScript,
                        Language::TypeScript,
                    ]),
                ),
                ignore_patterns: ::alloc::vec::Vec::new(),
            }
        }
        pub fn with_languages(mut self, languages: Vec<Language>) -> Self {
            self.languages = languages;
            self
        }
        pub fn with_ignore_patterns(mut self, patterns: Vec<String>) -> Self {
            self.ignore_patterns = patterns;
            self
        }
        pub fn walk(&self) -> Result<Vec<PathBuf>> {
            let mut files = Vec::new();
            let walker = WalkBuilder::new(&self.root)
                .hidden(false)
                .git_ignore(true)
                .build();
            for entry in walker {
                let entry = entry?;
                let path = entry.path();
                if path.is_file() && self.should_process(path) {
                    files.push(path.to_path_buf());
                }
            }
            Ok(files)
        }
        fn should_process(&self, path: &Path) -> bool {
            if let Some(ext) = path.extension() {
                let ext_str = ext.to_string_lossy();
                let lang = Language::from_extension(&ext_str);
                if !self.languages.contains(&lang) {
                    return false;
                }
                let path_str = path.to_string_lossy();
                for pattern in &self.ignore_patterns {
                    if glob::Pattern::new(pattern)
                        .map(|p| p.matches(&path_str))
                        .unwrap_or(false)
                    {
                        return false;
                    }
                }
                true
            } else {
                false
            }
        }
    }
    pub fn find_project_files(
        root: &Path,
        languages: Vec<Language>,
    ) -> Result<Vec<PathBuf>> {
        if root.is_file() {
            if let Some(ext) = root.extension() {
                let ext_str = ext.to_string_lossy();
                let lang = Language::from_extension(&ext_str);
                if languages.contains(&lang) || languages.is_empty() {
                    return Ok(
                        <[_]>::into_vec(::alloc::boxed::box_new([root.to_path_buf()])),
                    );
                }
            }
            Ok(::alloc::vec::Vec::new())
        } else {
            FileWalker::new(root.to_path_buf()).with_languages(languages).walk()
        }
    }
    pub fn count_lines(path: &Path) -> Result<usize> {
        let content = std::fs::read_to_string(path)?;
        Ok(content.lines().count())
    }
    pub fn get_file_size(path: &Path) -> Result<u64> {
        let metadata = std::fs::metadata(path)?;
        Ok(metadata.len())
    }
}

