                    propagated_risk,
                    dependents,
                    blast_radius,
                },
            })
        }
        fn weight(&self) -> f64 {
            1.2
        }
        fn explain(&self, context: &Context) -> String {
            match &context.details {
                ContextDetails::DependencyChain {
                    depth,
                    propagated_risk,
                    dependents,
                    blast_radius,
                } => {
                    match *blast_radius {
                        r if r > 10 => {
                            ::alloc::__export::must_use({
                                ::alloc::fmt::format(
                                    format_args!(
                                        "Critical dependency with blast radius {0} affecting {1} modules",
                                        blast_radius,
                                        dependents.len(),
                                    ),
                                )
                            })
                        }
                        r if r > 5 => {
                            ::alloc::__export::must_use({
                                ::alloc::fmt::format(
                                    format_args!(
                                        "Important dependency with {0} dependents (risk: {1:.1})",
                                        dependents.len(),
                                        propagated_risk,
                                    ),
                                )
                            })
                        }
                        r if r > 0 => {
                            ::alloc::__export::must_use({
                                ::alloc::fmt::format(
                                    format_args!(
                                        "Dependency depth {0} with limited impact",
                                        depth,
                                    ),
                                )
                            })
                        }
                        _ => "Isolated component with no dependencies".to_string(),
                    }
                }
                _ => "No dependency information".to_string(),
            }
        }
    }
    impl DependencyRiskProvider {
        fn calculate_dependency_depth(&self, function_name: &str) -> usize {
            if let Some(module) = self.calculator.find_module_for_function(function_name)
            {
                self.calculate_module_depth(&module.name, &mut HashSet::new())
            } else {
                0
            }
        }
        fn calculate_module_depth(
            &self,
            module_name: &str,
            visited: &mut HashSet<String>,
        ) -> usize {
            if visited.contains(module_name) {
                return 0;
            }
            visited.insert(module_name.to_string());
            let deps = self.calculator.graph.get_dependencies(module_name);
            if deps.is_empty() {
                return 0;
            }
            let max_depth = deps
                .iter()
                .map(|d| self.calculate_module_depth(&d.to, visited))
                .max()
                .unwrap_or(0);
            max_depth + 1
        }
    }
}

