    }
    fn is_orchestrator(
        func: &FunctionMetrics,
        func_id: &FunctionId,
        call_graph: &CallGraph,
    ) -> bool {
        let name_suggests_orchestration = is_orchestrator_by_name(&func_id.name)
            && func.cyclomatic <= 3;
        let is_simple_delegation = func.cyclomatic <= 2 && func.cognitive <= 3
            && delegates_to_tested_functions(func_id, call_graph, 0.8);
        name_suggests_orchestration || is_simple_delegation
    }
    fn is_io_wrapper(func: &FunctionMetrics) -> bool {
        if !contains_io_patterns(func) {
            return false;
        }
        if func.length < 20 {
            return true;
        }
        func.length <= 50 && is_io_orchestration(func)
    }
    fn is_entry_point_by_name(name: &str) -> bool {
        let entry_patterns = [
            "main",
            "run",
            "start",
            "init",
            "handle",
            "process",
            "execute",
            "serve",
            "listen",
        ];
        let name_lower = name.to_lowercase();
        entry_patterns
            .iter()
            .any(|pattern| {
                name_lower.starts_with(pattern) || name_lower.ends_with(pattern)
            })
    }
    fn is_orchestrator_by_name(name: &str) -> bool {
        let orchestrator_patterns = [
            "orchestrate",
            "coordinate",
            "manage",
            "dispatch",
            "route",
            "if_requested",
            "if_needed",
            "if_enabled",
            "maybe",
            "try_",
            "attempt_",
            "delegate",
            "forward",
        ];
        let name_lower = name.to_lowercase();
        if name_lower.contains("_if_") || name_lower.contains("_when_") {
            return true;
        }
        orchestrator_patterns.iter().any(|pattern| name_lower.contains(pattern))
    }
    fn delegates_to_tested_functions(
        func_id: &FunctionId,
        call_graph: &CallGraph,
        _threshold: f64,
    ) -> bool {
        let callees = call_graph.get_callees(func_id);
        if callees.is_empty() {
            return false;
        }
        callees.len() >= 2 && call_graph.detect_delegation_pattern(func_id)
    }
    fn contains_io_patterns(func: &FunctionMetrics) -> bool {
        let io_keywords = <[_]>::into_vec(
            ::alloc::boxed::box_new([
                "read",
                "write",
                "file",
                "socket",
                "http",
                "request",
                "response",
                "stream",
                "buffer",
                "stdin",
                "stdout",
                "stderr",
                "print",
                "input",
                "output",
            ]),
        );
        let name_lower = func.name.to_lowercase();
        io_keywords.iter().any(|keyword| name_lower.contains(keyword))
    }
    fn is_io_orchestration(func: &FunctionMetrics) -> bool {
        let name_lower = func.name.to_lowercase();
        let strong_io_patterns = [
            "output_",
            "write_",
            "print_",
            "format_",
            "serialize_",
            "save_",
            "export_",
            "display_",
            "render_",
            "emit_",
        ];
        let has_strong_io_name = strong_io_patterns
            .iter()
            .any(|pattern| name_lower.starts_with(pattern));
        has_strong_io_name && func.nesting <= 3
    }
    pub fn get_role_multiplier(role: FunctionRole) -> f64 {
        match role {
            FunctionRole::PureLogic => 1.5,
            FunctionRole::Orchestrator => 0.2,
            FunctionRole::IOWrapper => 0.1,
            FunctionRole::EntryPoint => 0.8,
            FunctionRole::Unknown => 1.0,
        }
    }
    pub fn calculate_semantic_priority(
        _func: &FunctionMetrics,
        role: FunctionRole,
        func_id: &FunctionId,
        call_graph: &CallGraph,
    ) -> f64 {
        let mut priority = match role {
            FunctionRole::PureLogic => 8.0,
            FunctionRole::Orchestrator => 2.0,
            FunctionRole::IOWrapper => 1.0,
            FunctionRole::EntryPoint => 6.0,
            FunctionRole::Unknown => 5.0,
        };
        let criticality = call_graph.calculate_criticality(func_id);
        priority *= criticality;
        priority.min(10.0)
    }
}

