    impl Default for CascadeImpact {
        fn default() -> Self {
            Self {
                total_risk_reduction: 0.0,
                affected_modules: Vec::new(),
                propagation_depth: 0,
            }
        }
    }
    pub struct AffectedModule {
        pub id: String,
        pub risk_reduction: f64,
        pub confidence: f64,
        pub depth: usize,
    }
    #[automatically_derived]
    impl ::core::clone::Clone for AffectedModule {
        #[inline]
        fn clone(&self) -> AffectedModule {
            AffectedModule {
                id: ::core::clone::Clone::clone(&self.id),
                risk_reduction: ::core::clone::Clone::clone(&self.risk_reduction),
                confidence: ::core::clone::Clone::clone(&self.confidence),
                depth: ::core::clone::Clone::clone(&self.depth),
            }
        }
    }
    #[automatically_derived]
    impl ::core::fmt::Debug for AffectedModule {
        #[inline]
        fn fmt(&self, f: &mut ::core::fmt::Formatter) -> ::core::fmt::Result {
            ::core::fmt::Formatter::debug_struct_field4_finish(
                f,
                "AffectedModule",
                "id",
                &self.id,
                "risk_reduction",
                &self.risk_reduction,
                "confidence",
                &self.confidence,
                "depth",
                &&self.depth,
            )
        }
    }
    pub struct CascadeCalculator {
        propagation_decay: f64,
        min_strength: f64,
        max_depth: usize,
    }
    impl Default for CascadeCalculator {
        fn default() -> Self {
            Self::new()
        }
    }
    impl CascadeCalculator {
        pub fn new() -> Self {
            Self {
                propagation_decay: 0.7,
                min_strength: 0.1,
                max_depth: 3,
            }
        }
        pub fn calculate(
            &self,
            target: &TestTarget,
            context: &Context,
        ) -> CascadeImpact {
            let mut impact = CascadeImpact::default();
            let mut visited = HashSet::new();
            let mut module_impacts: StdHashMap<String, AffectedModule> = StdHashMap::new();
            self.propagate_impact(
                target.id.clone(),
                1.0,
                &mut visited,
                &mut module_impacts,
                0,
                &context.dependency_graph,
                target.current_risk,
            );
            impact.affected_modules = module_impacts.into_values().collect();
            impact
                .affected_modules
                .sort_by(|a, b| {
                    b.risk_reduction.partial_cmp(&a.risk_reduction).unwrap()
                });
            impact.total_risk_reduction = impact
                .affected_modules
                .iter()
                .map(|m| m.risk_reduction)
                .sum();
            impact.propagation_depth = impact
                .affected_modules
                .iter()
                .map(|m| m.depth)
                .max()
                .unwrap_or(0);
            impact
        }
        #[allow(clippy::too_many_arguments)]
        fn propagate_impact(
            &self,
            node_id: String,
            strength: f64,
            visited: &mut HashSet<String>,
            module_impacts: &mut StdHashMap<String, AffectedModule>,
            depth: usize,
            graph: &DependencyGraph,
            source_risk: f64,
        ) {
            if depth > self.max_depth || strength < self.min_strength {
                return;
            }
            if !visited.insert(node_id.clone()) {
                return;
            }
            let dependents = self.get_dependents(&node_id, graph);
            for dependent_id in dependents {
                if let Some(dependent_node) = graph.nodes.get(&dependent_id) {
                    let edge_weight = self
                        .calculate_edge_weight(&node_id, &dependent_id, graph);
                    let propagated_strength = strength * edge_weight
                        * self.propagation_decay.powi(depth as i32);
                    let risk_reduction = self
                        .calculate_risk_reduction(
                            source_risk,
                            dependent_node.risk,
                            propagated_strength,
                        );
                    module_impacts
                        .entry(dependent_id.clone())
                        .and_modify(|m| {
                            if risk_reduction > m.risk_reduction {
                                m.risk_reduction = risk_reduction;
                                m.confidence = propagated_strength;
                                m.depth = depth + 1;
                            }
                        })
                        .or_insert(AffectedModule {
                            id: dependent_id.clone(),
                            risk_reduction,
                            confidence: propagated_strength,
                            depth: depth + 1,
                        });
                    self.propagate_impact(
                        dependent_id,
                        propagated_strength,
                        visited,
                        module_impacts,
                        depth + 1,
                        graph,
                        source_risk,
                    );
                }
            }
        }
        fn get_dependents(&self, node_id: &str, graph: &DependencyGraph) -> Vec<String> {
            graph
                .edges
                .iter()
                .filter(|edge| edge.from == node_id)
                .map(|edge| edge.to.clone())
                .collect()
        }
        fn calculate_edge_weight(
            &self,
            from: &str,
            to: &str,
            graph: &DependencyGraph,
        ) -> f64 {
            graph
                .edges
                .iter()
                .find(|edge| edge.from == from && edge.to == to)
                .map(|edge| edge.weight)
                .unwrap_or(0.5)
        }
        fn calculate_risk_reduction(
            &self,
            source_risk: f64,
            target_risk: f64,
            strength: f64,
        ) -> f64 {
            let base_reduction = (source_risk * 0.15).min(2.0);
            let risk_factor = (target_risk / 10.0).clamp(0.1, 1.5);
            let diminished_strength = strength.powf(0.8);
            base_reduction * risk_factor * diminished_strength
        }
    }
}

