                Expr::MethodCall(_) => self.handle_method_call_expr(expr),
                Expr::If(if_expr) => self.handle_if_expr(if_expr),
                Expr::Try(_) => syn::visit::visit_expr(self, expr),
                Expr::Unsafe(_) => self.handle_unsafe_expr(expr),
                Expr::Call(call) => self.handle_call_expr(call),
                _ => syn::visit::visit_expr(self, expr),
            }
        }
    }
    /// Calculate pattern-based complexity for a function
    pub fn analyze_patterns(block: &syn::Block) -> PatternComplexity {
        let mut detector = PatternDetector::new();
        detector.visit_block(block);
        detector.patterns
    }
}

pub mod delegation {
    use crate::core::FunctionMetrics;
    /// Detects if a function is likely a trivial delegation to another function
    pub fn is_trivial_delegation(func: &FunctionMetrics) -> bool {
        func.cyclomatic == 1 && func.cognitive <= 1 && func.length <= 3
    }
    /// Calculate a complexity weight factor for ROI calculations
    /// Trivial functions get heavily penalized to avoid dominating recommendations
    pub fn calculate_complexity_weight(func: &FunctionMetrics) -> f64 {
        match (func.cyclomatic, func.cognitive) {
            (1, 0..=1) => 0.1,
            (1, 2..=3) => 0.3,
            (2..=3, _) => 0.5,
            (4..=5, _) => 0.7,
            _ => 1.0,
        }
    }
}

