        match path_depth {
            0..=3 => (1, Some("Shallow module path (likely public)".to_string())),
            4..=5 => (0, None),
            _ => (-1, Some("Deep module path (likely internal)".to_string())),
        }
    }
    /// Check if the file is in a public module hierarchy
    fn is_in_public_module(path: &Path) -> bool {
