            && !path_str.contains("/examples/")
    }
    /// Check for API-like patterns in function names
    fn has_api_pattern_in_name(name: &str) -> bool {
        name.starts_with("get_") || name.starts_with("set_") || name.starts_with("with_")
            || name.starts_with("try_") || name.starts_with("is_")
            || name.starts_with("has_") || name.starts_with("create_")
            || name.starts_with("parse_") || name.starts_with("to_")
            || name.starts_with("into_") || name.starts_with("as_")
    }
    /// Check for builder or factory patterns
    fn is_builder_or_factory(name: &str) -> bool {
        name == "build" || name == "builder" || name.ends_with("_builder")
            || name.starts_with("create_") || name.starts_with("make_")
            || name.ends_with("_factory")
    }
    /// Check for constructor patterns
    fn is_constructor_pattern(name: &str) -> bool {
        name == "new" || name == "default" || name.starts_with("new_")
            || name.starts_with("from_") || name == "init" || name.starts_with("init_")
    }
    /// Check for public API prefixes
